        private void btnExportar_Click(object sender, EventArgs e)
        {
            ////Metodo de exportar
            //DevExpress.Export.ExportSettings.DefaultExportType = DevExpress.Export.ExportType.DataAware;
            var pivotExportOptions = new DevExpress.XtraPivotGrid.PivotXlsxExportOptions();
            pivotExportOptions.ExportType = DevExpress.Export.ExportType.WYSIWYG;

            //Selecciono el directorio destino

            FolderBrowserDialog fbd = new FolderBrowserDialog();
            fbd.Description = "Selecciona el directorio destino.";

            if (fbd.ShowDialog() == System.Windows.Forms.DialogResult.OK)
            {
                string NombreFile = "Ordenes_" + Variables.LoginModel.FullName.Replace(" ", "") + "_" + DateTime.Now.ToString("yyyy-MM-dd");
                pgcOrders.ExportToXlsx(fbd.SelectedPath + "\\" + NombreFile + ".xlsx", pivotExportOptions);
                Process.Start(fbd.SelectedPath + "\\" + NombreFile + ".xlsx");
                MessageBox.Show("Archivo " + NombreFile + ".xlsx" + " guardado.");
            }
        }

        public async Task cargar()
        {
            DateTime FechaIni = dtpFechaIni.Value;
            DateTime FechaFin = dtpFechaFin.Value;

            ////Se obtiene el cajero para filtrar la consulta            
            var temp = chcbxOperador.Properties.Items.ToList();
            string itemSeleccionado = "";
            ////Se la oficina para la consulta.            
            var tempAr = chcbxArea.Properties.Items.ToList();
            string ArSeleccionado = "";

            //Cajero(s) seleccionado(s)
            if (temp.Where(x => x.CheckState == CheckState.Checked).Count() == 0)
            {
                itemSeleccionado = "";
                mensaje = new MessageBoxForm("Advertencia: ", "Debe seleccionar un cajero.", TypeIcon.Icon.Cancel);
                result = mensaje.ShowDialog();
            }
            else
            {
                foreach (var item in temp)
                {
                    if (item.CheckState == CheckState.Checked)
                        itemSeleccionado = itemSeleccionado + item.Value + ",";
                }
                itemSeleccionado = itemSeleccionado.Substring(0, itemSeleccionado.Length - 1);
            }

            //Oficina(s) seleccionada(s)
            if (tempAr.Where(x => x.CheckState == CheckState.Checked).Count() == 0)
            {
                ArSeleccionado = "";
                mensaje = new MessageBoxForm("Advertencia: ", "Debe seleccionar una oficina.", TypeIcon.Icon.Cancel);
                result = mensaje.ShowDialog();
            }
            else
            {
                foreach (var item in tempAr)
                {
                    if (item.CheckState == CheckState.Checked)
                        ArSeleccionado = ArSeleccionado + item.Value + ",";
                }
                ArSeleccionado = ArSeleccionado.Substring(0, ArSeleccionado.Length - 1);
            }

            DataReportes dRep = new DataReportes() { FechaIni = FechaIni.ToString("yyyy-MM-dd"), FechaFin = FechaFin.ToString("yyyy-MM-dd"), CajeroId = itemSeleccionado, Oficinas = ArSeleccionado };

            HttpContent content;
            json = JsonConvert.SerializeObject(dRep);
            content = new StringContent(json, Encoding.UTF8, "application/json");
            
            var _resulTransaction = await Requests.SendURIAsync("/api/Reports/Orders", HttpMethod.Post, Variables.LoginModel.Token, content);

            if (_resulTransaction.Contains("error"))
            {
                mensaje = new MessageBoxForm("Error", _resulTransaction.Split(':')[1].Replace("}", ""), TypeIcon.Icon.Cancel);
                result = mensaje.ShowDialog();
            }
            else
            {
                List<DataOrders> lstData = JsonConvert.DeserializeObject<List<DataOrders>>(_resulTransaction);                
                if (lstData == null)
                {
                    mensaje = new MessageBoxForm("Sin Operaciones", "No se encontraron movimientos.", TypeIcon.Icon.Warning);
                    result = mensaje.ShowDialog();
                }
                else
                {
                    try
                    {
                        pgcOrders.DataSource = lstData;
                    }
                    catch (Exception e)
                    {
                        var res = e.Message;
                    }
                }
            }
        }
        public async void GeneratePdf()
        {
            loading = new Loading();
            loading.Show(this);
            DataReportes dRep = new DataReportes();
            dRep.FechaIni = dtpFechaIni.Value.ToString("yyyy-MM-dd");
            dRep.FechaFin = dtpFechaFin.Value.ToString("yyyy-MM-dd");
            dRep.CajeroId = getUsersIDSelecionados();
            if (string.IsNullOrEmpty(dRep.CajeroId))
            {
                loading.Close();
                return;
            }
            dRep.Oficinas = getOficinasSeleccionadas();
            if (string.IsNullOrEmpty(dRep.Oficinas))
            {
                loading.Close();
                return;
            }

            HttpContent content;
            json = JsonConvert.SerializeObject(dRep);
            content = new StringContent(json, Encoding.UTF8, "application/json");
            var _resulTransaction = await Requests.SendURIAsync("/api/Reports/Orders", HttpMethod.Post, Variables.LoginModel.Token, content);

            //var _resulTransaction = await Requests.SendURIAsync("/api/Reports/IncomeFromBox", HttpMethod.Post, Variables.LoginModel.Token, content);
            if (_resulTransaction.Contains("error"))
            {
                string error = JsonConvert.DeserializeObject<Error>(_resulTransaction).error;
                mensaje = new MessageBoxForm("Error", error, TypeIcon.Icon.Cancel);
                result = mensaje.ShowDialog();
                loading.Close();
                return;
            }

            var lstData = JsonConvert.DeserializeObject<List<DataOrders>>(_resulTransaction);
            if (lstData.Count == 0)
            {
                mensaje = new MessageBoxForm("Error", $"No hay transacciones para las fechas {dRep.FechaIni} a {dRep.FechaFin}, por lo cual no se puede generar un reporte", TypeIcon.Icon.Cancel);
                result = mensaje.ShowDialog();
                loading.Close();
                return;
            }
            //var lstFinal = lstData.Where(x => statusT.Contains(x.st)).ToList();

            try
            {

                HiQPdf.PdfDocument document = new HiQPdf.PdfDocument();

                document.SerialNumber = Properties.Settings.Default.SerialNumber;


                HiQPdf.PdfPage page1 = document.AddPage(HiQPdf.PdfPageSize.A4, new HiQPdf.PdfDocumentMargins(5), HiQPdf.PdfPageOrientation.Landscape);
                SetHeader(document, dRep.FechaIni, dRep.FechaFin, lstData.First().cajero);
                SetFooter(document);
                HiQPdf.PdfHtml html = new HiQPdf.PdfHtml(await getHtml(lstData), null);
                html.WaitBeforeConvert = 2;
                HiQPdf.PdfLayoutInfo layoutInfo = page1.Layout(html);
                MemoryStream stream = new MemoryStream();

                byte[] pdfBuffer = document.WriteToMemory();

                stream.Write(pdfBuffer, 0, pdfBuffer.Length);



                SOAPAP.UI.Visualizador.Preview oPreview = new SOAPAP.UI.Visualizador.Preview(stream);
                oPreview.ShowDialog();


            }
            catch (Exception excep)
            {

                mensaje = new MessageBoxForm("Error", "No se puede generar el documento", TypeIcon.Icon.Cancel);
                result = mensaje.ShowDialog();
            }
            loading.Close();
        }
        private void SetHeader(HiQPdf.PdfDocument document, string FechaI, string FechaF, string cajero)
        {
            document.CreateHeaderCanvas(130);

            float footerHeight = document.Header.Height;
            float footerWidth = document.Header.Width;


            //document.Header.Layout(pageNumberingText);
            //htmlToPdfDocument.Header.Height = 150;



            HiQPdf.PdfHtml headerHtml = new HiQPdf.PdfHtml(20, 10,
                   getHeaderHtml(FechaI, FechaF, cajero),
                   null);

            //htmlToPdfDocument.Header.Layout(headerHtml);
            document.Header.Layout(headerHtml);
        }

